Nigel's father hasn't been around in a while, but in 1940s London that's not unusual. Fortunately, his friend William can take up the slack personally and as the Whistling Skull! But when they join The Skeleton, will working together be enough to save the day against Nazi scientific horrors?

Thanks goes to Shining Knight for this release.

